        <div>
            <Container className="themed-container" fluid={true}>

                    <Row>

                        <Col sm="6">
                            <InputBudget />
                        </Col>
                        <Col sm="6">
                            <InputExpenses/>
                        </Col>

                    </Row>
                    <br></br>
                    <br></br>
                    <Row>


                        <DisplayBudget/>


                    </Row>

            </Container>
        </div>

    )
}

export default Budget;
